import React from "react";
import { motion } from "framer-motion";
import { FaEnvelope, FaPhone, FaMapMarkerAlt } from "react-icons/fa";

// Animation Variants
const fadeIn = {
  hidden: { opacity: 0, y: 20 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.6, ease: "easeOut" } },
};

const staggerContainer = {
  hidden: { opacity: 0 },
  visible: { opacity: 1, transition: { staggerChildren: 0.2 } },
};

// Data
const contactData = [
  { icon: <FaPhone className="text-green-600 text-xl" />, text: "+91 7870503085" },
  { icon: <FaMapMarkerAlt className="text-green-600 text-xl" />, text: "India" },
  { icon: <FaEnvelope className="text-green-600 text-xl" />, text: "chiranjeeviraj109@gmail.com" },
];

const experienceData = [
  {
    year: "2022 - Present",
    role: "Mobile Developer",
    company: "Tech Innovate",
    description: "Led development of cross-platform apps using React Native and integrated REST APIs.",
  },
  {
    year: "2021 - 2022",
    role: "Junior Mobile Developer",
    company: "AppWorks",
    description: "Built native iOS and Android apps with Swift and Kotlin, focusing on UI/UX.",
  },
  {
    year: "2020 - 2021",
    role: "Software Intern",
    company: "CodeCraft",
    description: "Assisted in developing mobile prototypes and Firebase integrations.",
  },
];

// Reusable Contact Item Component
const ContactItem = React.memo(({ icon, text }) => (
  <motion.div
    className="flex items-center gap-4 p-3 rounded-lg bg-white shadow-sm hover:shadow-md transition-shadow duration-300"
    variants={fadeIn}
    whileHover={{ y: -2 }}
  >
    {icon}
    <span className="text-gray-700 text-base font-medium">{text}</span>
  </motion.div>
));

// Reusable Experience Card Component
const ExperienceCard = React.memo(({ year, role, company, description }) => (
  <motion.div
    className="p-5 bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 border border-gray-200"
    variants={fadeIn}
    whileHover={{ y: -4 }}
  >
    <p className="text-sm text-gray-500 font-medium">{year}</p>
    <h4 className="text-xl font-bold text-gray-900 mt-1">{role}</h4>
    <p className="text-green-600 font-semibold">{company}</p>
    <p className="text-gray-600 text-sm mt-2 leading-relaxed">{description}</p>
  </motion.div>
));

export default function About() {
  return (
    <section
      className="py-16 md:py-20 px-4 sm:px-6 lg:px-8 max-w-5xl mx-auto space-y-16 bg-gradient-to-b from-gray-50 to-white"
      aria-label="About Me Section"
    >
      {/* Header */}
      <motion.div
        className="text-center md:text-left"
        variants={staggerContainer}
        initial="hidden"
        animate="visible"
      >
        <motion.h1
          className="text-4xl md:text-5xl font-extrabold text-gray-900 tracking-tight"
          variants={fadeIn}
        >
          About Me
        </motion.h1>
        <motion.h2
          className="mt-3 text-2xl md:text-3xl font-semibold text-green-600"
          variants={fadeIn}
        >
          Chiranjeevi Kumar
        </motion.h2>
        <motion.p
          className="mt-3 text-lg md:text-xl text-gray-600 italic max-w-2xl mx-auto md:mx-0"
          variants={fadeIn}
        >
          Mobile Developer based in <span className="font-semibold text-gray-700">India</span>
        </motion.p>
      </motion.div>

      {/* Contact Info */}
      <motion.div
        className="grid grid-cols-1 sm:grid-cols-3 gap-6 text-gray-700"
        variants={staggerContainer}
        initial="hidden"
        animate="visible"
        role="list"
      >
        {contactData.map((item, index) => (
          <ContactItem key={index} icon={item.icon} text={item.text} />
        ))}
      </motion.div>

      {/* Experience Section */}
      <motion.div
        className="bg-gray-100 p-8 md:p-10 rounded-xl shadow-lg"
        variants={staggerContainer}
        initial="hidden"
        animate="visible"
      >
        <motion.h3
          className="text-xl md:text-2xl font-bold text-gray-800"
          variants={fadeIn}
        >
          Experience
        </motion.h3>
        <motion.p
          className="mt-3 text-lg text-gray-600 max-w-3xl leading-relaxed"
          variants={fadeIn}
        >
          Hi! I’m Chiranjeevi Kumar, a passionate mobile developer with 3 years of experience crafting seamless applications for iOS and Android.
        </motion.p>
        <motion.a
          href="/resume.pdf"
          download="Chiranjeevi_Kumar_Resume.pdf"
          className="mt-6 inline-block px-8 py-3 bg-green-600 text-white font-semibold rounded-full hover:bg-green-700 transition-all duration-300 focus:outline-none focus:ring-2 focus:ring-green-500 focus:ring-offset-2 shadow-md"
          variants={fadeIn}
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          aria-label="Download Resume"
        >
          Download Resume
        </motion.a>

        <div className="mt-10 space-y-6">
          {experienceData.map((exp) => (
            <ExperienceCard
              key={exp.role}
              year={exp.year}
              role={exp.role}
              company={exp.company}
              description={exp.description}
            />
          ))}
        </div>
      </motion.div>
    </section>
  );
}
